import React from 'react'
import ReactDOM from 'react-dom'

class PracticalExperience extends React.Component {
    constructor () {
        super()

        this.state = {
            companyName: { text: '' },
            positionTitle: { text: '' },
            startDate: { text: '' },
            endDate: { text: '' },
        };
    };

    getCompanyName = (e) => {
        this.setState({
            companyName: {
                text: e.target.value
            }
        });
    };

    getPositionTitle = (e) => {
        this.setState({
            positionTitle: {
                text: e.target.value
            }
        });
    };

    getStartDate = (e) => {
        this.setState({
            startDate: {
                text: e.target.value
            }
        });
    };

    getEndDate = (e) => {
        this.setState({
            endDate: {
                text: e.target.value
            }
        });
    };

    onSubmitPractical = (e) => {
        e.preventDefault();
        this.setState({
            companyName: { text: '' },
            positionTitle: { text: '' },
            startDate: { text: '' },
            endDate: { text: '' },
        });
    };

    render() {
        const { companyName, positionTitle, startDate, endDate } = this.state;

        return (
            <div>
                <h2>Practical Experience</h2>
                <form onSubmit={this.onSubmitPractical}>
                    <label htmlFor="companyName">Company Name</label>
                        <input 
                            onChange={this.getCompanyName}
                            value={companyName.value}
                            type="text"
                            id="companyName">
                        </input>
                        <br></br>
                    <label htmlFor="positionTitle">Position Title</label>
                        <input 
                            onChange={this.getPositionTitle}
                            value={positionTitle.value}
                            type="text" 
                            id="positionTitle">
                        </input>
                        <br></br>
                    <label htmlFor="startDate">Start date of working</label>
                        <input 
                            onChange={this.getStartDate}
                            value={startDate.value}
                            type="date" 
                            id="startDate"
                            ></input>
                        <br></br>
                    <label htmlFor="endDate">End date of working</label>
                        <input 
                            onChange={this.getEndDate}
                            value={endDate.value}
                            type="date" 
                            id="endDate"
                            ></input>
                        <br></br>
                    <button type="submit">
                        Submit Practical Experience
                    </button>
                    <button type="submit">
                        Edit Practical experience
                    </button>
                </form>
            </div>
        )
    }
}

export default PracticalExperience;
